import requests
import json
import tkinter as tk
import keyboard
import base64
import os

def translate():
        url = "http://api.interpreter.caiyunai.com/v1/translator"
        
        token = "bi0w97gyxkx2bqhsg9ut"
        
        payload = {
                "source" : t1.get(0.0,"end"), 
                "trans_type" : "en2zh",
                "request_id" : "demo",
                }
        
        headers = {
                'content-type': "application/json",
                'x-authorization': "token " + token,
        }
        
        response = requests.request("POST", url, data=json.dumps(payload), headers=headers)
        #print(response.text)
        r = json.loads(response.text)['target']
        #print(r)

        t2.delete(0.0,"end")
        t2.insert("end",r)

